self.silicon_bzaz = silicon_bzaz
self.silicon_lips = silicon_lips
self.bad_eye = bad_eye
self.big_bro = big_bro

def creating_sister(self):
new_chakhla_haravot = copy.deepcopy(self)
return new_chakhla_haravot

@classmethod
def change_occupation_for_big_bro(cls, self):
if self.big_bro:
cls.occupation_type = "Adding_hairs"
return True
else:
return False
def main():
